"use strict";$(document).ready(function(){$(".fancybox-thumb").fancybox({openEffect:"none",closeEffect:"none",prevEffect:"elastic",nextEffect:"elastic",padding:0,helpers:{thumbs:{width:50,height:50}}});$(".fancybox-media").fancybox({openEffect:"fade",closeEffect:"fade",prevEffect:"elastic",nextEffect:"elastic",padding:0,helpers:{media:{}}});$.ajax({type:"POST",data:"&action=get_map",processData:false,cache:false,dataType:"json",success:function(a){var f=new google.maps.Map(document.getElementById("map"),{center:{lat:parseFloat(a.data.location.lat),lng:parseFloat(a.data.location.lng)},zoom:12,});var d=new google.maps.Marker({position:{lat:parseFloat(a.data.location.lat),lng:parseFloat(a.data.location.lng)},map:f,});var b=new google.maps.InfoWindow({content:"Tour",});b.open(f,d);d.addListener("click",function(){b.open(f,d)});if(a.data.transportation.lat&&a.data.transportation.lng){var e=new google.maps.Marker({position:{lat:parseFloat(a.data.transportation.lat),lng:parseFloat(a.data.transportation.lng)},map:f,});var c=new google.maps.InfoWindow({content:"Aqui te recogeremos",});c.open(f,e);e.addListener("click",function(){c.open(f,e)})}}})});